#include "StringVector.h"#include <iostream>StringVector(int n) {	value.resize(n);}StringVector(int n, std::string v) {	for (int i=0; i<n; i++)		value.push_back( v );}StringVector(const StringVector& v) {	value = v.value;}StringVector(std::vector<std::string> &v) {	value = v;}void print(void) const {	for (int i=0; i<value.size(); i++)		std::cout << value[i] << " ";	std::cout << std::endl;}RbObject* clone(void) const {	StringVector* x = new StringVector(*this);	return (RbObject*)x;}